/*
 *  Problem Description
        You have given a string A having Uppercase English letters.
        You have to find how many times subsequence "AG" is there in the given string.

        NOTE: Return the answer modulo 10^9 + 7 as the answer can be very large.

    Problem Constraints
        1 <= length(A) <= 10^5
        100000

    Example Input
        Input 1:
            A = "ABCGAG"
        Output 1:
            3

        Input 2:
            A = "GAB"
        Output 2:
            0
 */

using System;
using System.Text;

namespace _025_StringSpecialSubsequences
{
    class Program
    {
        static void Main(string[] args)
        {
            StringBuilder sb = new StringBuilder("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            sb.Append("");
            int len = sb.Length;
            var someInput = "ABCGA";
            Console.WriteLine(StringSpecialSubsequences(sb.ToString()));
        }

        static long StringSpecialSubsequences(string A)
        {
            int countG = 0;
            long countAG = 0;
            var charArr = A.ToCharArray();
            for (int i = charArr.Length - 1; i >= 0; i--)
            {
                if (charArr[i] == 'G') countG += 1;
                if (charArr[i] == 'A') countAG += countG;
            }
            return countAG % (1000000000 + 7) ;
        }
    }
}
